import React from 'react';
import { Input, Button } from 'antd';

// 타임라인 역할
const Home = () => {
    return (
        <>
            <div>Hello, Next!</div>
            <Input.TextArea
                placeholder="오늘의 이야기를 적어보세요"
                maxLength={140}
                autoSize={{ minRows: 4, maxRows: 4 }}
            />
            <Button >Image</Button>
            <Button type="primary" style={{ float : 'right'}}>Post</Button>
        </>
    );
};

export default Home;
